import React from "react";
import { Route, Switch, NavLink } from "react-router-dom";

import About from "./About";
import Service from "./Service";
import Blog from "./Blog";
import Careers from "./Careers";
import Team from "./Team";
import Portfolio from "./Portfolio";
import Testimonials from "./Testimonials";
import Contact from "./Contact";
import Error from "./Error";

const Navbar = () => {
  return (
    <>
      <div className="header">
        <div className="container">
          <div className="headeritems">
            <div className="header_logo">
              <NavLink activeClassName="is-active" to="./Home">
                <img />
              </NavLink>
            </div>
            <div className="header_menu">
              <NavLink activeClassName="btn btn-primary" to="./Home">
                Home
              </NavLink>
              <NavLink activeClassName="btn btn-primary" to="./About">
                About
              </NavLink>
              <NavLink activeClassName="btn btn-primary" to="./Contact">
                Contact
              </NavLink>
              <NavLink activeClassName="btn btn-primary" to="./Navbar">
                Navbar
              </NavLink>
            </div>
          </div>
        </div>
      </div>

      <Switch>
        <Route exact path="/About" component={About} />
        <Route exact path="/Service" component={Service} />
        <Route exact path="/Blog" component={Blog} />
        <Route exact path="/Careers" component={Careers} />
        <Route exact path="/Team" component={Team} />
        <Route exact path="/Portfolio" component={Portfolio} />
        <Route exact path="/Testimonials" component={Testimonials} />
        <Route exact path="/Contact" component={Contact} />
        <Route component={Error} />
      </Switch>
    </>
  );
};

export default Navbar;
